import React from 'react';
import c from './MyPosts.module.css';
import Post from './Post/Post';

function MyPosts() {
  return (
    <div className={c.content}>
      <div>My Posts</div>
      <Post message = 'Hello world'/>
      <Post message = 'World: hi 8)'/>
      <Post message = ''/>
    </div>
  );
}

export default MyPosts;
